import React from "react";
import PropTypes from "prop-types";
import { Col, Row } from "antd";

const SkillTree = () => {
  return (
    <Row>
      <Col style={{ backgroundColor: "yellow" }}></Col>
    </Row>
  );
};

SkillTree.propTypes = {
  character: PropTypes.string,
};

export default SkillTree;
